import { ArgumentsHost, Catch, ExceptionFilter, NotFoundException } from '@nestjs/common';
import { Response } from 'express';

@Catch(NotFoundException)
export class NotFoundExceptionFilter implements ExceptionFilter {
  catch(exception: NotFoundException, host: ArgumentsHost) {
    const ctx = host.switchToHttp();
    const response = ctx.getResponse<Response>();

    response
      .status(404)
      .send(
        '<!doctypehtml><html lang=en><meta charset=UTF-8><meta content="IE=edge"http-equiv=X-UA-Compatible><meta content="width=device-width,initial-scale=1"name=viewport><title>404 - Not found</title><link href=https://cdn.jsdelivr.net/npm/bootstrap@5.3.3/dist/css/bootstrap.min.css rel=stylesheet><link href=https://cdn.jsdelivr.net/npm/@fontsource/bellota-text@5.0.19/index.min.css rel=stylesheet><style>:root{--h1-color:#676565;--span-subtitle-color:#39425d;--background-loading:rgba(0, 0, 0, 0.2);--background-white:#ffffff;--background-gray:#d9d9d9;--border-color:#d0b080;--background-campos:#fbfbfb;--background-campos-original:#f4f8fb}.container-header{display:flex;justify-content:center;align-items:center;padding:50px}.display-flex{display:flex;justify-content:center;align-items:center;flex-direction:column}.texto-edit{margin-top:50px}.logo-edit{margin-top:10px}.logo-edit{max-width:100%;height:auto}.img-edit{margin-top:50px}.img-edit img{max-width:100%;height:auto}body{background:var(--background-campos-original)}h1{color:var(--h1-color);font-size:17px}@media only screen and (max-width:767px){body{height:calc(100dvh - 20dvh);display:flex;justify-content:center;align-items:center}}</style><section class=container-header><div class=display-flex><div class=logo-edit><img alt=logo src="data:image/png;base64,"width=250></div><div class=texto-edit><h1>La página que estás buscando no existe</h1></div><div class=img-edit><img alt=404 src="data:image/png;base64,"class=img-fluid></div></div></section>',
      );
  }
}
